description:
IconBuilder for Windows is a filter for use with Adobe Photoshop that makes creating icons a snap. By harnessing the professional power of Photoshop and Photoshop layers, IconBuilder provides icon artists with the most complete tool set possible for modern icon design and creation.

IconBuilder for Windows has the ability to construct and save icons for all the traditional Windows OS platforms (95, 98, 2000, NT &amp; XP), including the latest version, Windows Vista.
